import AdminLogin from './components/admin/AdminLogin'; // Admin login page
import Dashboard from './components/Dashboard'; // Admin dashboard page

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Add your routes here */}
        <Route path="/" element={<Home />} />  {/* Ensure this renders a Home component */}
        <Route path="/admin/login" element={<AdminLogin />} />
        <Route path="/admin/dashboard" element={<Dashboard />} />
        {/* More routes */}
      </Routes>
    </Router>
  );
};

export default App;
